import React,{Component} from "react";
import Signin from './signIn'
import Signup from './signUp' 
import './signInUpContainer.css'

class SignInOutContainer extends Component{
    constructor(props){
        super(props);
        this.state={
            page:"signIn"
        }


        this.changePage = this.changePage.bind(this);
    }
    changePage(){
        if(this.state.page==="signIn"){
            this.setState(this.state.page="signUp")
        }
        else{
            this.setState(this.state.page="signIn") 
        }
    }
    render(){
        return(
            <React.Fragment>
                <div class="tab">
                 <button class="tablinks" onclick={this.changePage}>Sign In</button>
                 <button class="tablinks" onclick={this.changePage}>Sign</button>
                </div>
                {this.state.page=="signIn"?<Signin/>:<Signup/>}
            </React.Fragment>

        )}
};

export default SignInOutContainer;
